package com.mbc.ontrip.country;

public class CountryDTO {
	int countrynum,branch;
	String country, tripname, tripimg, address, tripstyle,lat,llong,tripdetail;
	public CountryDTO() {
		super();
		// TODO Auto-generated constructor stub
	}
	public int getCountrynum() {
		return countrynum;
	}
	public void setCountrynum(int countrynum) {
		this.countrynum = countrynum;
	}
	public int getBranch() {
		return branch;
	}
	public void setBranch(int branch) {
		this.branch = branch;
	}
	public String getCountry() {
		return country;
	}
	public void setCountry(String country) {
		this.country = country;
	}
	public String getTripname() {
		return tripname;
	}
	public void setTripname(String tripname) {
		this.tripname = tripname;
	}
	public String getTripimg() {
		return tripimg;
	}
	public void setTripimg(String tripimg) {
		this.tripimg = tripimg;
	}
	public String getAddress() {
		return address;
	}
	public void setAddress(String address) {
		this.address = address;
	}
	public String getTripstyle() {
		return tripstyle;
	}
	public void setTripstyle(String tripstyle) {
		this.tripstyle = tripstyle;
	}
	public String getLat() {
		return lat;
	}
	public void setLat(String lat) {
		this.lat = lat;
	}
	public String getLlong() {
		return llong;
	}
	public void setLlong(String llong) {
		this.llong = llong;
	}
	public String getTripdetail() {
		return tripdetail;
	}
	public void setTripdetail(String tripdetail) {
		this.tripdetail = tripdetail;
	}

	
	
}
